export default function template(title, content = "") {
  let scripts = '';
  if (content) {
    scripts = `<script src="build/client.js"></script>`
  } else {
    scripts = ` <script src="build/bundle.js"> </script> `
  }
  let page = `<!DOCTYPE html>
